import './App.css';

import Navbar from "./components/Navbar";

import AboutContact from './pages/AboutContact';
import UniProjects from './pages/UniProjects';
import Skills from './pages/Skills';

import { BrowserRouter as Router, Routes, Route} from 'react-router-dom';

import MacTop from "./single-use-elements/MacTop"
//si pongo mac top aqui si que se ve pero ob¡bviamente esta en todas las páginas, si lo pongo dentro de AboutContact no funciona
//<MacTop/>

import Modal from './single-use-elements/Modal'

function App() {

  const [active, setActive] = useState(true);
  const toggle = () => {
    setActive(!active);
  }

  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/AboutContact" element={<AboutContact />} />
          <Route path='/UniProjects' element={<UniProjects/>} />
          <Route path='/Skills' element={<Skills/>} />
        </Routes>
        <Modal active={active} toggle={toggle}>
          <h1>Modal</h1>
        </Modal>
        <Navbar/>
      </Router>
    </div>
  );
}

export default App;
